clear

set(groot,'defaulttextinterpreter','latex');  
set(groot, 'defaultAxesTickLabelInterpreter','latex');  
set(groot, 'defaultLegendInterpreter','latex');

% Spring constants
syms K_t K_e 

% Distances
syms b_2 L_1 L_2 u_in
% body_2 Length_1 length_2
syms u_in0

% Angles
syms theta_1 theta_2
syms theta_10 theta_20

% Spring properties
syms E_t E_e I_t I_e l_t l_e

% Input force
syms F_in

% Calculate effective lengths and spring constants
L_2 = b_2 + l_t;
K_t = E_t * I_t / l_t;

% Linear spring has no change in effective length as it is mounted slightly
% offcenter due to needing to be attached to a body.

eq1 = u_in == 2*L_2*(cos(theta_20)-cos(theta_2)) %[output:92a8e8c1]
theta_2_sol = solve(eq1, theta_2);
theta_2_sol = theta_2_sol(1) %[output:1b84634b]

d_theta_2 = diff(theta_2_sol, u_in) %[output:6e179918]

% Introduce Lagrange coordinates
phi_2 = theta_2_sol-theta_20 %[output:548deae5]
phi_3 = L_2*(sin(theta_2_sol)-sin(theta_20)) %[output:3fe43e21]

dphi_2 = diff(phi_2, u_in) %[output:6d1e73e5]
dphi_3 = diff(phi_3, u_in) %[output:5cbbf1ef]

T_t = -4*K_t*phi_2 %[output:1ef64d2e]
T_e = -K_e*phi_3 %[output:8087122f]

eq2 = F_in + T_t*dphi_2 + T_e*dphi_3 %[output:0aa8ac49]

F_in_sol = solve(eq2, F_in) %[output:1fa2249b]
subs(F_in_sol, K_e, 0) %[output:9adf25ea]


% Flexure elements properties
E_flexure = 179e9;
b = 4e-3;
h = 0.4e-3;
I_value = b * h^3 / 12;

% Parameter dictionary
theta_0 = deg2rad(25);
p_vars = [theta_20, l_t,   I_t,     E_t,       b_2,  K_e];
p_vals = [theta_0,  5e-3,  I_value, E_flexure, 0.1];
p_vals0 = [p_vals, 0];
p_vals1 = [p_vals, 1000];

u_in0 = double(solve(subs(eq1,[p_vars, theta_2],[p_vals0,theta_0]),u_in));


F_in_sol_no_spring = subs(F_in_sol, p_vars, p_vals0);
F_in_sol_spring = subs(F_in_sol, p_vars, p_vals1);
theta_2_sol = subs(theta_2_sol, p_vars, p_vals0);

xmax = 0.2;
xmin = -0.02;
figure(1), clf; %[output:04431e94]
tiledlayout(2,1) %[output:04431e94]
nexttile; %[output:04431e94]
hold on; %[output:04431e94]
grid on; %[output:04431e94]
fplot(F_in_sol_no_spring, [u_in0, xmax]) %[output:04431e94]
fplot(F_in_sol_spring, [u_in0, xmax]) %[output:04431e94]
legend("No elastic band", "With elastic band") %[output:04431e94]
ylim([0, 40]) %[output:04431e94]
xlim([xmin,xmax]) %[output:04431e94]
ylabel("$F$ Force") %[output:04431e94]
nexttile; %[output:04431e94]
hold on; %[output:04431e94]
grid on; %[output:04431e94]
fplot(theta_2_sol, [u_in0, xmax]) %[output:04431e94]
xlim([xmin,xmax]) %[output:04431e94]
xlabel("$U$ displacement") %[output:04431e94]
ylabel("$\theta$ displacement") %[output:04431e94]




